pub enum SudoMsg {
    Bank(BankSudo),
    Custom(Empty),
    Staking(StakingSudo),
    Wasm(WasmSudo),
}

pub enum BankSudo {
    Mint {
            to_address: String,
            amount: Vec<Coin>,
        },
}

pub enum Error {
    EmptyAttributeKey {
            value: String,
        },
    EmptyAttributeValue {
            key: String,
        },
    ReservedAttributeKey(String),
    EventTypeTooShort(String),
    UnsupportedWasmQuery(WasmQuery),
    UnsupportedWasmMsg(WasmMsg),
    UnregisteredCodeId(usize),
}

pub enum StakingSudo {
    Slash {
            validator: String,
            percentage: Decimal,
        },
}
